import { Route, Routes } from "react-router-dom";
import MiddlePage from "./components/MiddlePage";
import Stack from "react-bootstrap/Stack";

function App() {
  return (
    <Routes className="mainElement">
      <Route
        path="/"
        element={
          <Stack gap={10}>
            <MiddlePage />
          </Stack>
        }
      />
    </Routes>
  );
}

export default App;
